import React from 'react'
import { projectsData } from './Data'
import { projectNav } from './Data'

const Works = () => {
    return (
        <div className="work__filters">
            {projectNav.map((item, index) => {
                return (
                    <span className="work__item">
                        {item.name}
                    </span>
                )
            })}
        </div>
    )
}

export default Works
